import React from 'react'
import HomePage from './components/homepage/HomePage'
import Navbar from './components/Navbar'
import { BrowserRouter, Routes, Route } from "react-router-dom";
const App = () => {
  return (
    <BrowserRouter>
    <Routes>
    <Navbar />
      <HomePage />
    </Routes>
    

    </BrowserRouter>
  )
}

export default App
